webpackJsonp([1243],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-arrayprototypepop.json":function(e,a){e.exports={data:{markdownRemark:{html:"<p>The JavaScript array method <code>.pop()</code> will remove the last element from an array and returns that element.</p>\n<p><strong>Syntax</strong></p>\n<pre><code>var array = [1, 2, 3, 4, 5];\narray.pop();\n</code></pre>\n<h2>Description</h2>\n<p><code>.pop()</code> 'pops' the last element in an array off and returns that element</p>\n<p><code>.pop()</code> will return <code>undefined</code> if the array it is called on is empty.</p>\n<h2>Examples</h2>\n<p><strong>Popping off the last value in an array</strong></p>\n<pre><code>var array = [1, 2, 3, 4, 5];\nconsole.log(array);\n// Console will output 1, 2, 3, 4, 5\n\narray.pop();\n/* If we console.log(array.pop()); the console would output 5\nbecause 5 was popped off the array by .pop(). */\n\nconsole.log(array);\n/* Console will output 1, 2, 3, 4 and \nthe variable array now contains the set [1, 2, 3, 4] */\n</code></pre>\n<p>Source <a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/pop\">MDN</a></p>",frontmatter:{title:"Array.prototype.pop",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-arrayprototypepop/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-arrayprototypepop/"}}}});
